  [],\n\t\"revision_timestamp\": \"2015-12-20T22:08:17.168718\",\n\t\"name\": \"monk-seals-tag-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains records for all
  tags applied to Hawaiian monk seals since 1981.  These tags were applied by  PSD
  personnel and cooperating scientists as part of the ongoing monk seal population
  assessment efforts.   In addition, this data set contains tagging records for all
  seals that were tagged by USFWS in earlier years, and still present in the population
  when the current research effort began.  These tagging records extend as far back
  as 1967.   The remainder of the USFWS tagging data (data for seals that disappeared
  prior to the inception of the Hawaiian Monk Seal Research Program) are housed at
  PIFSC in paper form.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
